import "./App.css";
import LoginPage from "./pages/index.js";
import React from "react";
import { useState } from "react";

const response = await axios.get(
	"http://localhost:3000/users/632846307869907503dc522a"
);

const data = response.data;

function App() {
	return (
		<div className="App">
			<LoginPage />
			{data}
		</div>
	);
}

export default App;
